const About = () => {
    return (
        <React.Fragment>
            <section className="h-screen flex items-center justify-center">
                <div>
                    <p>Passionate and dedicated software engineer skilled in HTML, CSS, JavaScript, React, Node.js, Express.js, and MongoDB. I craft elegant solutions for complex problems, turning innovative ideas into user-friendly applications. Collaborative and committed to excellence, seeking impactful projects and continual growth.</p>
                </div>


            </section>
        </React.Fragment>
    )
}

export default About
